import React, { Component } from 'react';

// Components
import Button from '../Button';
import Modal from '../Modal';

// Icons
import { MdCloudDownload, MdKeyboardArrowDown } from 'react-icons/md';

// Style
import { Container, LoginText } from './styles';

class Login extends Component {
	onLoginOrCreateClick() {
		<Modal />;
	}

	onCountryClick() {
		alert('Countries will be coming soon');
	}

	onButtonClick() {
		alert('Ark Software will be coming soon');
	}
	render() {
		return (
			<Container>
				<span>
					<LoginText>
						<a href="/">Login</a>
						&nbsp; or &nbsp;
						<a href="/">Create Account</a>
					</LoginText>
					<div onClick={() => this.onCountryClick()}>
						Country <MdKeyboardArrowDown size={15} />
					</div>
					<Button
						type="ark"
						label="Install Ark"
						icon={<MdCloudDownload />}
						onClick={() => this.onButtonClick()}
					/>
				</span>
			</Container>
		);
	}
}

export default Login;
